import React from "react";
import Slider from "react-slick";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import './Hero.css'; // Assurez-vous d'avoir vos styles CSS pour le carrousel

const Head = () => {
  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1
  };

  return (
    <>
      <section className='head'>
        <div className='container flexSB'>
          <div className='logo'>
            <Slider {...settings}>
              <div>
                <img src={require("../../../public/back.webp")} alt="Logo 1" className='logo' />
              </div>
              <div>
                <img src={require("../../../assets/about.PNG")} alt="Logo 2" className='logo' />
              </div>
              <div>
                <img src={require("../../../assets/dark_arrow.")} alt="Logo 3" className='logo' />
              </div>
              {/* Ajoutez plus d'images ici si n√©cessaire */}
            </Slider>
            <h1> </h1>
            <span></span>
          </div>

          <div className='social'>
            <i className='fab fa-facebook-f icon'></i>
            <i className='fab fa-instagram icon'></i>
            <i className='fab fa-twitter icon'></i>
            <i className='fab fa-youtube icon'></i>
          </div>
        </div>
      </section>
    </>
  );
};

export default Head;
